import React from "react";
import { FaFacebookF, FaLinkedinIn, FaTwitter } from "react-icons/fa";

// into TeamOne
let teamCore = [
  {
    images: "01",
    name: "Brigadier(Retd) Sajjad Sardar ",
    title: "Core Member",
    designation: "Former Brigadier in Pakistan Army with an illustrious career",
    SocialNetworkIcon: <FaLinkedinIn />,
    linkedin: "https://www.linkedin.com/in/sajjad-sardar/",

    // socialNetwork: [
    //   {
    //     Icon: <FaLinkedinIn />,
    //     url: "https://www.linkedin.com/in/sajjad-sardar/",
    //   },
    // ],
  },
  {
    images: "02",
    name: "Syed Wajahat Hussain",
    title: "Core Member",
    designation:
      "An engineer with experience of over thirty years in Product Development, International Trade",
    SocialNetworkIcon: <FaLinkedinIn />,
    linkedin: "https://www.linkedin.com/in/sajjad-sardar/",
  },
  {
    images: "03",
    name: "Dr Akhtar Hussain",
    title: "Core Member",
    designation:
      "Over twenty five years of experience in Software Suite development as well as Geographic Information System.",
    SocialNetworkIcon: <FaLinkedinIn />,
    url: "https://www.linkedin.com/in/sajjad-sardar/",
    // socialNetwork: [
    //   {
    //     Icon: <FaFacebookF />,
    //     url: "#",
    //   },
    //   {
    //     Icon: <FaLinkedinIn />,
    //     url: "#",
    //   },
    //   {
    //     Icon: <FaTwitter />,
    //     url: "#",
    //   },
    // ],
  },
  {
    images: "04",
    name: "Syed Muhammad Abbas",
    title: "Core Member",
    designation:
      "A business executive with experience in Economics and Business Management having expertise in Business Mapping and Ergonomics",
    SocialNetworkIcon: <FaLinkedinIn />,
    url: "https://www.linkedin.com/in/sajjad-sardar/",
    // socialNetwork: [
    //   {
    //     Icon: <FaFacebookF />,
    //     url: "#",
    //   },
    //   {
    //     Icon: <FaLinkedinIn />,
    //     url: "#",
    //   },
    //   {
    //     Icon: <FaTwitter />,
    //     url: "#",
    //   },
    // ],
  },
];

// into TeamTwo
export const advisors = [
  {
    images: "01",
    name: "Dr Yarjan Abdul Samad",
    title: "Advisor",
    designation:
      "Space Scientist with expertise in Technology Materials, known for his work in Graphene",
    socialNetwork: [
      {
        Icon: <FaFacebookF />,
        url: "#",
      },
      {
        Icon: <FaLinkedinIn />,
        url: "#",
      },
      {
        Icon: <FaTwitter />,
        url: "#",
      },
    ],
  },
  {
    images: "02",
    name: "Dr Syed Ali Raza",
    title: "Advisor",
    designation:
      "Expertise in Artificial Intelligence, Wireless Networking and Internet of Things.",
    socialNetwork: [
      {
        Icon: <FaFacebookF />,
        url: "#",
      },
      {
        Icon: <FaLinkedinIn />,
        url: "#",
      },
    ],
  },
  {
    images: "03",
    name: "Dr Syed Najam Abbas",
    title: "Advisor",
    designation:
      "Head of the Space Science Department, Institute of Space Technology.",
    socialNetwork: [
      {
        Icon: <FaFacebookF />,
        url: "#",
      },
      {
        Icon: <FaLinkedinIn />,
        url: "#",
      },
      {
        Icon: <FaTwitter />,
        url: "#",
      },
    ],
  },
  {
    images: "04",
    name: "Dr Jamil H Kazmi",
    title: "Advisor",
    designation:
      "Meritorious Professor and a seasoned Geographer with a distinguished career.",
    socialNetwork: [
      {
        Icon: <FaFacebookF />,
        url: "#",
      },
      {
        Icon: <FaLinkedinIn />,
        url: "#",
      },
      {
        Icon: <FaTwitter />,
        url: "#",
      },
    ],
  },
  {
    images: "01",
    name: "Dr Ghulam Muhammad Mehdi",
    title: "Advisor",
    designation:
      "Expertise in Machine Learning, Deep Learning and Algorithms Development.",
    socialNetwork: [
      {
        Icon: <FaFacebookF />,
        url: "#",
      },
      {
        Icon: <FaLinkedinIn />,
        url: "#",
      },
      {
        Icon: <FaTwitter />,
        url: "#",
      },
    ],
  },
];

// into TeamOne
export default teamCore;
